import React, { useState, useEffect } from 'react';

function SchoolwiseInterval() {
  const [intervals, setIntervals] = useState([]);
  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:4300/get-interval'); // Adjust the API endpoint as necessary
        if (!response.ok) throw new Error('Network response was not ok');
        const data = await response.json();
        setIntervals(data);
      } catch (error) {
        setError(error.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="container mt-3">
      <h2>School-wise Interval Data</h2>
      {isLoading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>Error: {error}</p>
      ) : (
        <table className="table table-striped">
          <thead>
            <tr>
              <th>#</th>
              <th>PC Name</th>
              <th>School Name</th>
              <th>Start Time</th>
              <th>Last Time</th>
              <th>Total Time (s)</th>
              <th>Lab Number</th>
              <th>PC Number</th>
            </tr>
          </thead>
          <tbody>
            {intervals.map((interval, index) => (
              <tr key={interval._id}>
                <td>{index + 1}</td>
                <td>{interval.pcname}</td>
                <td>{interval.schoolname}</td>
                <td>{interval.starttime}</td>
                <td>{interval.lasttime}</td>
                <td>{interval.totaltime}</td>
                <td>{interval.labnum}</td>
                <td>{interval.pcnum}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default SchoolwiseInterval;
